    return (
        <div>
            <h1 className={`
                font-black text-3xl
                text-gray-900 dark:text-gray-100
            `}>
                {dados.titulo}
            </h1>
            <h2 className={`
                font-light text-sm
                dark:text-gray-300
            `}>
                {dados.subtitulo}
            </h2>
        </div>
    )
}
